import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import './App.css';
import './Mobile.css'; // New mobile-friendly styles

// Components
import Header from './components/Header';
import Footer from './components/Footer';

// Original Pages
import Login from './pages/Login';
import Register from './pages/Register';
import Onboarding from './pages/Onboarding';
import Dashboard from './pages/Dashboard';
import Profile from './pages/Profile';

// New Mobile-Friendly Pages
import DashboardNew from './pages/DashboardNew';
import ProfileNew from './pages/ProfileNew';
import RanchNew from './pages/RanchNew';

// Herd Pages
import HerdsList from './pages/herds/HerdsList';
import AddHerd from './pages/herds/AddHerd';
import EditHerd from './pages/herds/EditHerd';
import HerdDetail from './pages/herds/HerdDetail';

// Milk Production Pages
import MilkProductionList from './pages/milk/MilkProductionList';
import AddMilkProduction from './pages/milk/AddMilkProduction';
import EditMilkProduction from './pages/milk/EditMilkProduction';

// Auth Context
import { useAuth } from './contexts/AuthContext';

// Protected Route Component
const ProtectedRoute = ({ children }) => {
  const { currentUser, loading } = useAuth();

  if (loading) {
    return <div className="container">Loading...</div>;
  }

  if (!currentUser) {
    return <Navigate to="/login" />;
  }

  return children;
};

function App() {
  return (
    <div className="app">
      <Header />

      <main>
        <Routes>
          {/* Public Routes */}
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />

          {/* Protected Routes */}
          <Route 
            path="/onboarding" 
            element={
              <ProtectedRoute>
                <Onboarding />
              </ProtectedRoute>
            } 
          />

          <Route 
            path="/dashboard" 
            element={
              <ProtectedRoute>
                <Dashboard />
              </ProtectedRoute>
            } 
          />

          <Route 
            path="/profile" 
            element={
              <ProtectedRoute>
                <Profile />
              </ProtectedRoute>
            } 
          />

          {/* Herd Routes */}
          <Route 
            path="/herds" 
            element={
              <ProtectedRoute>
                <HerdsList />
              </ProtectedRoute>
            } 
          />

          <Route 
            path="/herds/add" 
            element={
              <ProtectedRoute>
                <AddHerd />
              </ProtectedRoute>
            } 
          />

          <Route 
            path="/herds/edit/:id" 
            element={
              <ProtectedRoute>
                <EditHerd />
              </ProtectedRoute>
            } 
          />

          <Route 
            path="/herds/:id" 
            element={
              <ProtectedRoute>
                <HerdDetail />
              </ProtectedRoute>
            } 
          />

          {/* Milk Production Routes */}
          <Route 
            path="/milk-production" 
            element={
              <ProtectedRoute>
                <MilkProductionList />
              </ProtectedRoute>
            } 
          />

          <Route 
            path="/milk-production/add" 
            element={
              <ProtectedRoute>
                <AddMilkProduction />
              </ProtectedRoute>
            } 
          />

          <Route 
            path="/milk-production/edit/:id" 
            element={
              <ProtectedRoute>
                <EditMilkProduction />
              </ProtectedRoute>
            } 
          />

          {/* Default Route */}
          <Route path="/" element={<Navigate to="/login" />} />
        </Routes>
      </main>

      <Footer />
    </div>
  );
}

export default App;
